DROP PROCEDURE IF EXISTS SP_EXPENSE_PERSONAL_INSERT;
CREATE PROCEDURE SP_EXPENSE_PERSONAL_INSERT(IN FILENAME TEXT,
IN USERSTAMP VARCHAR(50),
OUT SUCCESS_MESSAGE TEXT)
BEGIN
	DECLARE FAILURE_ECN_DATA TEXT;
	DECLARE FAIL_ECNDATA TEXT;
	DECLARE SUCCESS_ECNDATA TEXT;
	DECLARE FAILURE_ECNDATA TEXT;
	DECLARE SUCCESSECNDATA TEXT;
	DECLARE FAILUREECNDATA TEXT;
	DECLARE PATCHFILENAME VARCHAR(100);
	DECLARE PHSTATUS TINYINT;
	DECLARE MINID INTEGER;
	DECLARE MAXID INTEGER;
	DECLARE ECNDATA TEXT;
	DECLARE USTAMP VARCHAR(50);
	DECLARE INVOICEDATE TIMESTAMP;
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN 
		ROLLBACK;
		DROP TABLE IF EXISTS TEMP_EXPENSE_PERSONAL;
	END;
	SET AUTOCOMMIT = 0;
 	START TRANSACTION;
	SET SUCCESS_ECNDATA =  (SELECT EMC_DATA FROM ERROR_MESSAGE_CONFIGURATION WHERE EMC_ID=469);
	SET FAILURE_ECNDATA =  (SELECT EMC_DATA FROM ERROR_MESSAGE_CONFIGURATION WHERE EMC_ID=470);
	SET FAILURE_ECN_DATA = (SELECT EMC_DATA FROM ERROR_MESSAGE_CONFIGURATION WHERE EMC_ID=473);
	SET SUCCESSECNDATA = (SELECT REPLACE(SUCCESS_ECNDATA,'[FILENAME]',FILENAME));
	SET FAILUREECNDATA = (SELECT REPLACE(FAILURE_ECNDATA,'[FILENAME]',FILENAME));
	SET FAIL_ECNDATA = (SELECT REPLACE(FAILURE_ECN_DATA,'[FILENAME]',FILENAME));
	IF EXISTS(SELECT PH_FILE_NAME FROM PATCH_HISTORY WHERE PH_FILE_NAME = FILENAME AND PH_STATUS = 1) THEN
		SET SUCCESS_MESSAGE = FAILUREECNDATA;
	END IF;
	SET PATCHFILENAME = (SELECT PH_FILE_NAME FROM PATCH_HISTORY WHERE PH_FILE_NAME = FILENAME);
	SET PHSTATUS = (SELECT PH_STATUS FROM PATCH_HISTORY WHERE PH_FILE_NAME = FILENAME AND PH_STATUS = 0);
	IF ((PATCHFILENAME IS NOT NULL) AND (PHSTATUS = 0)) OR (PATCHFILENAME IS NULL)THEN
		DROP TABLE IF EXISTS TEMP_EXPENSE_PERSONAL;
		CREATE TABLE TEMP_EXPENSE_PERSONAL(
		ID INTEGER AUTO_INCREMENT PRIMARY KEY,
		PE_TYPE_OF_EXPENSE TEXT,
		PE_PERSONAL_EXPENSE TEXT NOT NULL,
		PE_PERSONAL_INVOICE_DATE DATE NOT NULL,
		PE_PERSONAL_AMOUNT DECIMAL(7,2) NOT NULL,
		PE_PERSONAL_INVOICE_ITEMS TEXT NOT NULL,
		PE_PERSONAL_INVOICE_FROM VARCHAR(200) NOT NULL,
		PE_PERSONAL_COMMENTS TEXT NULL,
		TIMESTAMP TIMESTAMP NULL,
		PE_USERSTAMP VARCHAR(50) NOT NULL);
		ALTER TABLE `TEMP_EXPENSE_PERSONAL` ADD COLUMN ECN_ID INTEGER NOT NULL;
		ALTER TABLE `TEMP_EXPENSE_PERSONAL` ADD COLUMN ULDID INTEGER NOT NULL;
		SET MINID = (SELECT MIN(ID) FROM `TEMP_EXPENSE_PERSONAL`);
	SET MAXID = (SELECT MAX(ID) FROM `TEMP_EXPENSE_PERSONAL`);
		WHILE(MINID <= MAXID)DO
			SET USTAMP = (SELECT PE_USERSTAMP FROM `TEMP_EXPENSE_PERSONAL` WHERE ID = MINID);
			SET ECNDATA = (SELECT PE_PERSONAL_EXPENSE FROM `TEMP_EXPENSE_PERSONAL` WHERE ID = MINID);
			SET INVOICEDATE = (SELECT PE_PERSONAL_INVOICE_DATE FROM `TEMP_EXPENSE_PERSONAL` WHERE ID = MINID);
			UPDATE `TEMP_EXPENSE_PERSONAL` SET ECN_ID = (SELECT ECN_ID FROM EXPENSE_CONFIGURATION WHERE ECN_DATA = ECNDATA AND CGN_ID = 24),
			ULDID = (SELECT ULD_ID FROM USER_LOGIN_DETAILS WHERE ULD_LOGINID = USTAMP),
			TIMESTAMP = INVOICEDATE WHERE ID = MINID;
		SET MINID = MINID+1;
		END WHILE;
		SELECT ECN_ID,PE_PERSONAL_INVOICE_DATE,PE_PERSONAL_AMOUNT,PE_PERSONAL_INVOICE_ITEMS,PE_PERSONAL_INVOICE_FROM,PE_PERSONAL_COMMENTS,ULDID,TIMESTAMP FROM TEMP_EXPENSE_PERSONAL;
		SET SUCCESS_MESSAGE = SUCCESSECNDATA;
	END IF;
	DROP TABLE IF EXISTS `TEMP_EXPENSE_PERSONAL`;
	COMMIT;
END;
CALL SP_EXPENSE_PERSONAL_INSERT(FILENAME,USERSTAMP,@SUCCESS_MESSAGE);